{
  "openapi": "3.0.0",
  "info": {
    "version": "0.32.0",
    "title": "Waves Data Service",
    "description": "This is a a public Waves Data Services API documentation. The goal of the API is to provide a simple and convenient way to get data from Waves blockchain."
  },
  "servers": [
    {
      "url": "/v0"
    }
  ],
  "tags": [
    {
      "name": "assets",
      "description": "Asset info: ticker, name, decimals, issuer, etc."
    },
    {
      "name": "candles",
      "description": "Candles"
    },
    {
      "name": "pairs",
      "description": "DEX volume, change24, last trade price"
    },
    {
      "name": "transactions",
      "description": "Transactions info"
    },
    {
      "name": "aliases",
      "description": "Get aliases by name or by address"
    },
    {
      "name": "info",
      "description": "Service info: version, etc."
    },
    {
      "name": "matchers",
      "description": "Candles, pairs and other trading endpoints"
    }
  ],
  "paths": {
    "/assets/{id}": {
      "get": {
        "tags": [
          "assets"
        ],
        "summary": "Get asset info by asset ID",
        "operationId": "getAssetById",
        "parameters": [
          {
            "name": "id",
            "in": "path",
            "description": "asset ID",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Asset info",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/Asset"
                }
              }
            }
          },
          "404": {
            "description": "Asset not found"
          }
        }
      }
    },
    "/assets": {
      "get": {
        "tags": [
          "assets"
        ],
        "summary": "Get a list of assets info from a list of IDs",
        "operationId": "getAssetListByIds",
        "parameters": [
          {
            "in": "query",
            "name": "ids",
            "description": "Asset IDs array",
            "required": false,
            "schema": {
              "type": "array",
              "items": {
                "type": "string"
              }
            }
          },
          {
            "in": "query",
            "name": "ticker",
            "description": "Examples: WAVES, BTC, \\*. A wildcard request **ticker=***  returns all assets with tickers.",
            "required": false,
            "example": "*",
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "search",
            "description": "Assets prefix-search by the query in asset names, tickers, id.",
            "required": false,
            "example": "bitc",
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "after",
            "description": "After which assets its should search",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "limit",
            "description": "How many Assets to await in response.",
            "required": false,
            "schema": {
              "type": "integer",
              "minimum": 1,
              "maximum": 100,
              "default": 100
            }
          }
        ],
        "responses": {
          "200": {
            "description": "List of Assets",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfAsset"
                }
              }
            }
          },
          "400": {
            "description": "Invalid query, check params"
          }
        }
      },
      "post": {
        "tags": [
          "assets"
        ],
        "summary": "Get a list of assets info from a list of IDs",
        "operationId": "postAssetListByIds",
        "requestBody": {
          "required": false,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "ids": {
                    "type": "array",
                    "description": "Asset IDs array",
                    "items": {
                      "type": "string"
                    }
                  },
                  "ticker": {
                    "type": "string",
                    "description": "Examples: WAVES, BTC, \\*. A wildcard request **ticker=***  returns all assets with tickers.",
                    "example": "*"
                  },
                  "search": {
                    "type": "string",
                    "description": "Assets prefix-search by the query in asset names, tickers, id.",
                    "example": "bitc"
                  },
                  "after": {
                    "type": "string",
                    "description": "After which assets its should search"
                  },
                  "limit": {
                    "type": "integer",
                    "description": "How many Assets to await in response.",
                    "minimum": 1,
                    "maximum": 100,
                    "default": 100,
                    "example": 100
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "List of Assets",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfAsset"
                }
              }
            }
          },
          "400": {
            "description": "Invalid query, check params"
          }
        }
      }
    },
    "/candles/{amountAsset}/{priceAsset}": {
      "get": {
        "tags": [
          "candles"
        ],
        "summary": "Get candles by amount and price assets. Maximum amount of candles in response â€“ 1440.",
        "operationId": "getCandles",
        "parameters": [
          {
            "name": "amountAsset",
            "in": "path",
            "description": "Asset ID of the amount asset",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "priceAsset",
            "in": "path",
            "description": "Asset ID of the price asset",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "timeStart",
            "description": "Time range filter, start. (ISO-8601 or timestamp in milliseconds, UTC)",
            "required": true,
            "schema": {
              "oneOf": [
                {
                  "type": "string",
                  "format": "date-time"
                },
                {
                  "type": "number"
                }
              ]
            }
          },
          {
            "in": "query",
            "name": "timeEnd",
            "description": "Time range filter, end. Defaults to now. (ISO-8601 or timestamp in milliseconds, UTC)",
            "schema": {
              "oneOf": [
                {
                  "type": "string",
                  "format": "date-time"
                },
                {
                  "type": "number"
                }
              ]
            }
          },
          {
            "in": "query",
            "name": "interval",
            "description": "Candle interval. One of 1M, 1w, 1d, 12h, 6h, 4h, 3h, 2h, 1h, 30m, 15m, 5m, 1m.",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "matcher",
            "description": "Matcher address",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "List of Candles.</br>time - candle open time</br>timeClose - candle close time",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfCandle"
                }
              }
            }
          },
          "404": {
            "description": "Candle not found"
          }
        }
      }
    },
    "/pairs/{amountAsset}/{priceAsset}": {
      "get": {
        "tags": [
          "pairs"
        ],
        "summary": "Get pair info by amount and price assets",
        "operationId": "getPair",
        "parameters": [
          {
            "name": "amountAsset",
            "in": "path",
            "description": "Asset ID of the amount asset",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "priceAsset",
            "in": "path",
            "description": "Asset ID of the price asset",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "matcher",
            "description": "Matcher address",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Pair info",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/Pair"
                }
              }
            }
          },
          "404": {
            "description": "Pair info not found"
          }
        }
      }
    },
    "/pairs": {
      "get": {
        "tags": [
          "pairs"
        ],
        "summary": "1) Get list of pairs info by serialized pairs list; 2) Get all list of pairs info by limit (sort by volume in WAVES)",
        "operationId": "getPairsListAll",
        "parameters": [
          {
            "name": "pairs",
            "in": "query",
            "description": "`{amountAsset}/{priceAsset}` strings list",
            "required": false,
            "schema": {
              "type": "array",
              "items": {
                "type": "string"
              }
            }
          },
          {
            "in": "query",
            "name": "search_by_asset",
            "description": "For searching pairs, that have the `search_by_asset` in asset names, tickers, id of one asset of the pair.",
            "required": false,
            "example": "bitc",
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "search_by_assets",
            "description": "For searching pairs, that have the `search_by_asset` in asset names, tickers, id of one asset of the pair.",
            "required": false,
            "schema": {
              "type": "array",
              "items": {
                "type": "string"
              }
            }
          },
          {
            "in": "query",
            "name": "match_exactly",
            "description": "Whether to search assets of pairs exactly or not. Parameter position is corresponds to asset position.",
            "required": false,
            "schema": {
              "type": "array",
              "items": {
                "type": "boolean"
              }
            }
          },
          {
            "in": "query",
            "name": "matcher",
            "description": "Matcher address",
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "limit",
            "in": "query",
            "description": "How many pairs to await in response.",
            "required": false,
            "schema": {
              "type": "number",
              "minimum": 1,
              "maximum": 1000,
              "default": 100
            }
          }
        ],
        "responses": {
          "200": {
            "description": "List of Pairs info",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfPair"
                }
              }
            }
          }
        }
      },
      "post": {
        "tags": [
          "pairs"
        ],
        "summary": "1) Get list of pairs info by serialized pairs list; 2) Get all list of pairs info by limit (sort by volume in WAVES)",
        "operationId": "postPairsListAll",
        "requestBody": {
          "required": false,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "pairs": {
                    "type": "array",
                    "description": "`{amountAsset}/{priceAsset}` strings list",
                    "items": {
                      "type": "string"
                    }
                  },
                  "search_by_asset": {
                    "type": "string",
                    "description": "For searching pairs, that have the `search_by_asset` in asset names, tickers, id of one asset of the pair.",
                    "example": "bitc"
                  },
                  "search_by_assets": {
                    "type": "array",
                    "description": "For searching pairs, that have the `search_by_asset` in asset names, tickers, id of one asset of the pair.",
                    "items": {
                      "type": "string"
                    }
                  },
                  "match_exactly": {
                    "type": "array",
                    "description": "Whether to search assets of pairs exactly or not. Parameter position is corresponds to asset position.",
                    "items": {
                      "type": "boolean"
                    }
                  },
                  "matcher": {
                    "type": "string",
                    "description": "Matcher address"
                  },
                  "limit": {
                    "type": "number",
                    "description": "How many pairs to await in response.",
                    "example": 100,
                    "minimum": 1,
                    "maximum": 1000,
                    "default": 100
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "List of Pairs info",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfPair"
                }
              }
            }
          }
        }
      }
    },
    "/transactions/all/{id}": {
      "get": {
        "tags": [
          "transactions"
        ],
        "summary": "Get any transaction info by id",
        "operationId": "getTxsAll",
        "parameters": [
          {
            "name": "id",
            "in": "path",
            "description": "transaction ID",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Any transaction",
            "content": {
              "application/json": {
                "schema": {
                  "oneOf": [
                    {
                      "$ref": "#/components/schemas/TxTransfer"
                    },
                    {
                      "$ref": "#/components/schemas/TxData"
                    },
                    {
                      "$ref": "#/components/schemas/TxLease"
                    },
                    {
                      "$ref": "#/components/schemas/TxLeaseCancel"
                    },
                    {
                      "$ref": "#/components/schemas/TxMassTransfer"
                    },
                    {
                      "$ref": "#/components/schemas/TxExchange"
                    },
                    {
                      "$ref": "#/components/schemas/TxSetScript"
                    },
                    {
                      "$ref": "#/components/schemas/TxSetAssetScript"
                    }
                  ]
                }
              }
            }
          },
          "404": {
            "description": "Transaction not found"
          }
        }
      }
    },
    "/transactions/all": {
      "get": {
        "tags": [
          "transactions"
        ],
        "summary": "Get a list of transactions by applying filters",
        "operationId": "searchTxsAll",
        "parameters": [
          {
            "in": "query",
            "name": "ids",
            "description": "Transaction IDs array",
            "required": false,
            "schema": {
              "type": "array",
              "items": {
                "type": "string"
              }
            }
          },
          {
            "in": "query",
            "name": "sender",
            "description": "Address-sender of the transaction",
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "timeStart",
            "description": "Time range filter, start. Defaults to first transaction's time_stamp in db. (ISO-8601 or timestamp in milliseconds, UTC)",
            "schema": {
              "oneOf": [
                {
                  "type": "string",
                  "format": "date-time"
                },
                {
                  "type": "number"
                }
              ]
            }
          },
          {
            "in": "query",
            "name": "timeEnd",
            "description": "Time range filter, end. Defaults to now. (ISO-8601 or timestamp in milliseconds, UTC)",
            "schema": {
              "oneOf": [
                {
                  "type": "string",
                  "format": "date-time"
                },
                {
                  "type": "number"
                }
              ]
            }
          },
          {
            "in": "query",
            "name": "after",
            "description": "Cursor in base64 encoding. Holds information about timestamp, id, sort.",
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "query",
            "name": "sort",
            "description": "Sort order. Gonna be rewritten by cursor's sort if present.",
            "schema": {
              "type": "string",
              "enum": [
                "asc",
                "desc"
              ],
              "default": "desc"
            }
          },
          {
            "in": "query",
            "name": "limit",
            "description": "How many transactions to await in response.",
            "schema": {
              "type": "integer",
              "minimum": 1,
              "maximum": 100,
              "default": 100
            }
          }
        ],
        "responses": {
          "200": {
            "description": "List of transactions satisfying provided filters",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfAllTx"
                }
              }
            }
          }
        }
      },
      "post": {
        "tags": [
          "transactions"
        ],
        "summary": "Get a list of transactions by applying",
        "operationId": "postSearchTxsAll",
        "requestBody": {
          "required": false,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "ids": {
                    "type": "array",
                    "description": "Transaction IDs array",
                    "items": {
                      "type": "string"
                    }
                  },
                  "sender": {
                    "type": "string",
                    "description": "Address-sender of the transaction"
                  },
                  "timeStart": {
                    "oneOf": [
                      {
                        "type": "string",
                        "format": "date-time"
                      },
                      {
                        "type": "number"
                      }
                    ],
                    "description": "Time range filter, start. Defaults to first transaction's time_stamp in db. (ISO-8601 or timestamp in milliseconds, UTC)",
                    "example": "2019-01-01T00:00:00.000"
                  },
                  "timeEnd": {
                    "oneOf": [
                      {
                        "type": "string",
                        "format": "date-time"
                      },
                      {
                        "type": "number"
                      }
                    ],
                    "description": "Time range filter, end. Defaults to now. (ISO-8601 or timestamp in milliseconds, UTC)",
                    "example": "2020-01-01T00:00:00.000"
                  },
                  "after": {
                    "type": "string",
                    "description": "Cursor in base64 encoding. Holds information about timestamp, id, sort."
                  },
                  "sort": {
                    "type": "string",
                    "description": "Sort order. Gonna be rewritten by cursor's sort if present.",
                    "enum": [
                      "asc",
                      "desc"
                    ],
                    "default": "desc"
                  },
                  "limit": {
                    "type": "integer",
                    "description": "How many transactions to await in response.",
                    "minimum": 1,
                    "maximum": 100,
                    "default": 100,
                    "example": 100
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "List of transactions satisfying provided filters",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfAllTx"
                }
              }
            }
          }
        }
      }
    },
    "/transactions/genesis/{id}": {
      "get": {
        "tags": [
          "transactions"
        ],
        "summary": "Get genesis transaction info by id",
        "operationId": "getTxsGenesis",
        "parameters": [
          {
            "name": "id",
