                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "List of genesis transactions satisfying provided filters",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListOfTxGenesis"
                }
              }
